// src/pages/UsersPage.js
import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import '../css/users.css';
import defaultImageProfile from '../css/profile.jpg';

const UsersPage = () => {
  const [users, setUsers] = useState([]);
  const [dropdownResults, setDropdownResults] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [searchTerm, setSearchTerm] = useState('');
  const [sortOrder, setSortOrder] = useState('latest');
  const [page, setPage] = useState(1);
  const pageSize = 12;
  const navigate = useNavigate(); // Initialize useNavigate

  useEffect(() => {
    const fetchUsers = async () => {
      setLoading(true);
      try {
        const token = localStorage.getItem('token');
        const response = await fetch(`http://localhost:8080/users?page=${page}&pageSize=${pageSize}&sortColumn=${sortOrder.split('_')[0]}&sortDirection=${sortOrder.split('_')[1]}`, {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        });
        if (!response.ok) {
          throw new Error('Failed to fetch users');
        }
        const data = await response.json();
        console.log('Fetched users data:', data); // Log the entire fetched data
        setUsers(data.users || []);
      } catch (error) {
        setError(error.message);
      } finally {
        setLoading(false);
      }
    };

    fetchUsers();
  }, [sortOrder, page]);

  useEffect(() => {
    if (searchTerm) {
      const results = users.filter(user =>
        user.name.toLowerCase().includes(searchTerm.toLowerCase())
      );
      console.log('Dropdown results:', results); // Log search results
      setDropdownResults(results);
    } else {
      setDropdownResults([]);
    }
  }, [searchTerm, users]);

  const handleSearchChange = (event) => {
    setSearchTerm(event.target.value);
    setPage(1);
  };

  const handleSortChange = (event) => {
    setSortOrder(event.target.value);
    setPage(1);
  };

  const handlePageChange = (newPage) => {
    setPage(newPage);
  };

  const handleImageError = (e) => {
    e.target.src = defaultImageProfile; // Use default image on error
  };

  const handleSearchResultClick = (userId) => {
    // Navigate to the edit page for the selected user
    navigate(`/users/edit/${userId}`);
  };

  const handleManageRoleClick = (userId) => {
    // Navigate to the role management page for the selected user
    navigate(`/users/manage-role/${userId}`);
  };

  if (loading) return <div>Loading...</div>;
  if (error) return <div>Error: {error}</div>;

  return (
    <div className="users-page">
      <div className="search-sort-bar">
        <input
          type="text"
          value={searchTerm}
          onChange={handleSearchChange}
          placeholder="Search users..."
          className="search-input"
        />
        <select value={sortOrder} onChange={handleSortChange} className="sort-select">
          <option value="latest_desc">Latest</option>
          <option value="name_asc">Name A-Z</option>
          <option value="name_desc">Name Z-A</option>
        </select>
      </div>
      {dropdownResults.length > 0 && (
        <div className="dropdown-results">
          {dropdownResults.map((user) => (
            <div
              key={user.id}
              className="dropdown-item"
              onClick={() => handleSearchResultClick(user.id)}
            >
              {user.name}
            </div>
          ))}
        </div>
      )}
      <div className="users-list">
        {users.map((user) => (
          <div key={user.id} className="user-card">
            <img
              src={user.profileImage || defaultImageProfile}
              alt={user.name}
              className="user-image"
              onError={handleImageError}
            />
            <div className="user-info">
              <div className="user-name">{user.name}</div>
              <div className="user-email">{user.email}</div>
              <div className="user-role">{user.role}</div>
              <div className="user-actions">
                <button onClick={() => handleSearchResultClick(user.id)} className="edit-button">
                  Edit
                </button>
                <button onClick={() => handleManageRoleClick(user.id)} className="manage-role-button">
                  Manage Role
                </button>
              </div>
            </div>
          </div>
        ))}
      </div>
      <div className="pagination">
        <button
          disabled={page === 1}
          onClick={() => handlePageChange(page - 1)}
        >
          Previous
        </button>
        <span>Page {page}</span>
        <button
          disabled={users.length < pageSize}
          onClick={() => handlePageChange(page + 1)}
        >
          Next
        </button>
      </div>
    </div>
  );
};

export default UsersPage;
